import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Connexion from "./pages/Connexion";
import Home from "./pages/Home";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Connexion />} />
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>

  )
};

export default App;
